INSERT INTO `job_listing` (`id`, `user_id`, `job_title`, `job_description`, `salary`, `job_category`, `job_type`, `no_of_vacancy`, `edu_requirments`, `experiences_req`, `job_requirements`, `other_benefits`, `job_location`, `country`, `job_deadline`, `post_date`, `status`, `fea_job`, `company_name`, `phone`, `email`) VALUES
(1, 'FJJR01', 'PHP Programmer (Laravel)', '<ul>\r\n<li>ATI Limited, being a leading Software Development Company over the last 20 years both in locally and globally, is providing the most comprehensive application suite to empower organizations to increase business performance at all levels to maximize industry mandated compliance and corporate governance programs.</li>\r\n<li>The focusing area of ATI Limited is Web Based Application Development, Customized Software Development, Offshore &amp; Onsite Development, System Integration, Mobile Application Development (Android, iOS), Database Maintenance and Data Warehousing, Data Center Solution, Data Migration, Data Integration, Application Up gradation, Managed Service etc.</li>\r\n<li>The Company is looking for recruiting PHP Programmer who has real-time experience on Software Design, Development, Requirement Analysis, etc. Candidates who do not meet the below mentioned criteria are instructed not to apply.</li>\r\n<li>\r\n<ul>\r\n<li>Adequate knowledge on Overall Scope Analysis, Architectural Design, Process Flow, Design / Diagram of the Application, Code, and Test Applications and Databases.</li>\r\n<li>Able to Analyze, Design and Develop Software in Web based using: PHP 5.6, Java Script, MySQL 5.5, Oracle, SQL Server 2008 etc.</li>\r\n<li>Excellent Command over PHP 5 with HTML5, CSS3, Java Script &amp; AJAX, JQuery, MYSQL and also cable in Cross Browser Compatibility issues.</li>\r\n<li>Experience with an MVC Framework such as Laravel is must.</li>\r\n<li>Basic knowledge about Python will be considered as added advantage.</li>\r\n<li>Must have excellent UI skills and should be capable to complete a complex project in PHP by himself as a core developer.</li>\r\n<li>Very good understanding of UML, SOA and Object Oriented Design, Programming, Principles and Analysis.</li>\r\n<li>Write and Maintain Technical Specifications, Documentation to Describe Program Development, Coding, Testing, Changes, and Corrections and Installation.</li>\r\n<li>Elicit Software Requirements using document analysis, requirements workshops, storyboards, site visits, business process descriptions, use cases, scenarios, event lists, tasks and workflow analysis.</li>\r\n<li>Participate in requirements prioritization and verification, ensuring that requirement statements are complete, consistent, feasible, unambiguous, and standard.</li>\r\n</ul>\r\n</li>\r\n</ul>', '35000', 'IT/Telecommunication', 'Full Time', '2', '<ul>\r\n<li>B.Sc/ M.Sc in Computer Science &amp; Engineering or similar disciplines</li>\r\n<li>Professional Certification in similar discipline will be considered as added qualification</li>\r\n</ul>', '<ul>\r\n<li>3 to 4 year(s)</li>\r\n<li>The applicants should have experience in the following area(s):<br />Team Leader (Software), Technical Lead (Software), Programmer/ Software Engineer, Software Development, MVC, Laravel</li>\r\n<li>The applicants should have experience in the following business area(s):<br />IT Enabled Service, Software Company</li>\r\n</ul>', '<ul>\r\n<li class=\"age\">Age 26 to 30 year(s)</li>\r\n<li>Must be familiar with any relational database like Microsoft SQL Server, MySQL, Oracle, etc.</li>\r\n<li>Must be familiar with any IDE like Microsoft Visual Studio, Eclipse, Netbeans, etc.</li>\r\n<li>Real time experience in developing Management Dashboard using different BI tools i.e. Azure, Power BI /Oracle BI</li>\r\n<li>The incumbent must be delivery-oriented. The capacity to deliver a successful project on time is a key requirement.</li>\r\n<li>Must be able to learn new technologies, tools, and techniques quickly and with minimal supervision</li>\r\n<li>Readiness to work in a team environment (On-Shore/Off-Shore)</li>\r\n<li>Must have strong communication skills in English, both written and spoken.</li>\r\n</ul>', '<p>Bonuse 2 Time</p>', 'Dhaka', 'Bangladesh', '2022-01-01', '2020-04-03', 1, 0, 'Bangladesh BD', '00000000000', 'happy.ging580@gmail.com'),
(2, 'FJJR01', 'Pre - Sales Engineer, Structure Cabling System', '<ul>\r\n<li>This position provides technical sales support and application design of Structured Cabling, services and solutions.</li>\r\n<li>The pre-sales engineer \"Structured Cabling \"supports the sales representatives with customer.</li>\r\n<li>Presentations and provides system configuration support during the design process.</li>\r\n<li>Provide expert level technical designs and assistance to the sales team.</li>\r\n<li>Planning, designing and/or engineering Structured Cabling.</li>\r\n<li>Determining the right technology for the customers.</li>\r\n<li>Provide guidance, direction and assistance in the resolution of customer issues.</li>\r\n<li>Contribution on responses to RFPs and RFIs.</li>\r\n<li>Remove technically related buying objections from the sales cycle.</li>\r\n<li>Build and maintain relationship with customers.</li>\r\n<li>Ensure total customer satisfaction with the customer\'s implementation experience.</li>\r\n</ul>', '', 'IT/Telecommunication', 'Full Time', '5', '<ul>\r\n<li>Bachelor of Science in EEE / CSE / Telecommunication engineering from Reputed University,</li>\r\n<li>Masters in related subject from Reputed University will be preferable.</li>\r\n</ul>', '<ul>\r\n<li>2 to 5 year(s)</li>\r\n<li>The applicants should have experience in the following business area(s):<br />IT Enabled Service</li>\r\n</ul>', '<ul>\r\n<li class=\"age\">Age 30 to 40 year(s)</li>\r\n<li>2 years\' experience in Structured Cabling.</li>\r\n<li>Minimum 2 years\' prior experience working with design and configuration of Structured Cabling products and solutions.</li>\r\n<li>Motivated and hard worker.</li>\r\n<li>Excellent written, verbal and interpersonal communication skills, presentation skills and attention to details.</li>\r\n<li>Fluent in English.</li>\r\n</ul>', '<p>sdfadfg</p>', 'Dhaka', 'Bangladesh', '2022-01-01', '2020-04-03', 1, 1, 'Bangladesh BD', '00000000000', 'happy.ging580@gmail.com'),
(3, 'FJJR05', 'Head of Accounts & Finance', '<ul>A reputed Group of Companies of the country is looking for potential candidate as Head of Accounts &amp; Finance of Group at its corporate Head Office in Moghbazar, Dhaka.Be prepared accounts by newly built &amp; standard with modernization system, obtain and maintain a thorough understanding of the financial reporting and general accounting structure, ensure an accurate and timely monthly, quarterly and year end closing of accounts and financial reporting, responsible for Group TAX &amp; VAT with handle VAT &amp; TAX audit conducted by NBR, AG and other Government Authorities</ul>\r\n<p>&nbsp;</p>', '', 'Bank/Non-Bank Fin. Institution', 'Full Time', '1', '<p>Applicant must be M. Com. or MBA (Accounting/ Finance) with CA (Inter) or CA (CC)</p>', '<p>10 to 12 year(s)<br />The applicants should have experience in the following area(s):<br />Accounts, Finance, Internal Audit, Tax (VAT/ Customs Duty/ Income Tax), Cash Management<br />The applicants should have experience in the following business area(s):<br />Group of Companies, Manufacturing (FMCG), Pharmaceuticals</p>', '<p>Age 30 to 45 year(s)<br />Ability to work independently, with supervision.<br />Knowledge and ability in the use of software applications(ERP Tally &amp; HR Payroll<br />Ability to effectively use a modern automated financial management system<br />Strong professional accounts skills and the ability to prepared new account system.<br />Ability to work effectively under stressful conditions.<br />Ability to exercise initiative and sound judgment and to react with discretion under varying conditions.</p>', '<p>No&nbsp;</p>', 'Dhaka Division', 'Bangladesh', '2022-01-01', '2020-04-03', 1, 0, 'Bangladesh BD', '00000000000', 'happy.ging580@gmail.com'),
(4, 'FJJR05', 'Assistant Executive-Loan Operations', '<p>Responsible for credit operations for loan/lease segment.</p>', '3500000', 'Bank/Non-Bank Fin. Institution', 'Full Time', '5', '<p>Minimum BBA/Bachelor\'s degree from any reputed university.</p>', '<p>Sound Communication Skill<br />Good analytical ability.<br />Ability and willingness to work under pressure</p>', '<p>Sound Communication Skill<br />Good analytical ability.<br />Ability and willingness to work under pressure</p>', '<p>Sound Communication Skill<br />Good analytical ability.<br />Ability and willingness to work under pressure</p>', 'Dhaka', 'Bangladesh', '2022-01-01', '2020-04-03', 1, 0, 'Bangladesh BD', '00000000000', 'happy.ging580@gmail.com'),
(9, 'FJJR07', 'Customer Care Executive', '<ul>\r\n<li>Answer customer calls, assist in completing customer orders</li>\r\n<li>Answer customer queries over the phone</li>\r\n<li>Make outbound calls as needed</li>\r\n<li style=\"text-align: left;\">Produce sales through phone call<br />Additional Requirements</li>\r\n</ul>', '15000', 'Customer Support/Call Centre', 'Full Time', '20', '<p>Minimum HSC</p>', '<p>minimum 1 year&nbsp;</p>', '<ul class=\"bn\">\r\n<li class=\"bn\">Age 18 to 30 years</li>\r\n<li class=\"bn\">Both males and females are allowed to apply</li>\r\n<li>Good interpersonal skill</li>\r\n<li>Computer Literacy is must</li>\r\n<li>Good typing speed in both Bengali &amp; English</li>\r\n<li>Fluency in both Bengali &amp; English</li>\r\n</ul>', '<ul>\r\n<li>Lunch Facilities: Partially Subsidize</li>\r\n<li>Salary Review: Yearly</li>\r\n<li>Festival Bonus: 2(Yearly)</li>\r\n<li>According to the company policy</li>\r\n</ul>', 'dhaka', 'Bangladesh', '2022-01-01', '2020-04-03', 1, 1, 'Digicon Group', '1551244122', 'digicon.marketever@gmail.com');

