INSERT INTO `pages` (`id`, `title`, `designation`) VALUES
(1, 'FAQ', '<h5>HOW DO I ACTIVATE MY ACCOUNT?</h5>\r\n<p>The instructions to activate your account will be sent to your email once you have submitted the registration form. If you did not receive this email, your email service provider&rsquo;s mailing software may be blocking it. You can try checking your junk / spam folder or contact us at.</p>\r\n<p>&nbsp;</p>\r\n<h5>HOW CAN I CHANGE MY&nbsp;Title ADDRESS?</h5>\r\n<p>By default, the last used title&nbsp;address will be saved into to your Sample Store account. When you are checking out your order, the default shipping address will be displayed and you have the option to amend it if you need to.</p>\r\n<p>&nbsp;</p>\r\n<h5>WHAT DO YOU MEAN BY POINTS? HOW DO I EARN IT?</h5>\r\n<p>Because you are important to us, we want to know what you think about the products. As an added value, every time you rate the products you earn points which go straight to your account. 1 point are added to your account for every review that you give. You will need those points in order to redeem the sample products. So keep rating the products to keep earning points!</p>'),
