(1, 'IT Trainning', 'Web Programming ', '<h2>Introduction</h2>\r\n<p>The banking profession, today, is a nice career for all students from the commerce, economics, and accounts domain. For beginners, it&rsquo;s the first step to understand the global economy, discover marketplace challenges, and identify themselves with a rewarding career which provides them tremendous opportunities, both nationally and internationally.<br /><br /><strong>Objectives</strong><br />1. Get an overview of operations of banks&nbsp;<br />2. Understand monogram of banks&nbsp;<br />3. Identify products and customers of a bank/NBFI and understand sales and relationship management in banking industry<br />4. Gain practical financial analysis skills needed for credit approval<br />5. Gain understanding of banking rules and regulations in Bangladesh<br />6. Understand credit risk, operational risks and market risk management for banks&nbsp;<br />7. Understand international trade &ndash; import and export related activities of a bank<br />8. Gain essential administrative, team management, meeting and presentation skills<br />9. Language and communication skills for banking professionals &ndash; introduction to financial English<br />10. Go global &ndash; know about international qualifications and scope of professional qualifications for finance professionals</p>\r\n<h2>Methodology</h2>\r\n<p>Interactive</p>\r\n<h2>Contents of Training:</h2>\r\n<p><strong>MODULE 1 : Economy, financial system &amp; banks</strong><br /><br /><strong>Bangladesh Economy at a glance</strong><br />Macroeconomic statistics of Bangladesh (Population, GDP, Inflation, unemployment, trade balance etc) / Growth strategies &amp; prospects of Bangladesh/ thrust sectors of Bangladesh &amp; investment opportunities/ policy frameworks (both monetary &amp; fiscal) of Bangladesh.<br /><strong>Overview of financial system, financial market &amp; financial institutions</strong><br />Structure of Financial system (financial institution, financial instruments &amp; financial markets)/Role of financial markets in the economy/Functions of financial markets/Constituents of financial markets/Money markets &amp;its instruments/Capital markets &amp; its instruments/Financial institutions in Bangladesh.<br /><strong>Legal &amp; regulatory Infrastructure and key laws relating to Banking Industry emphasizing Bank Companies Act, 1991</strong><br />-The Bank Companies Act,1991 &amp; special focus on the sections ( Disposal of non-banking assets, unclaimed deposit and valuable articles/Restrictions on removal of records and documents, buying shares of banks, payment of dividend, advances/Requirements pertaining to paid up capital, reserve fund, cash reserve, and liquid assets/Directors related sections ( election of new directors, certain privilege of directors )/Responsibility of CEO/Power of Bangladesh Bank (to inspect, to give directions, to remove directors, to dissolve the Board of Directors). -Salient features &amp; relevant sections of Company Act, 1994/Types of companies &amp; features of a company. Different Types of share (ordinary &amp; preferential)/Different types of Debenture (simple, mortgage, redeemable, irredeemable, registered &amp; bearer)/Different types of share capital ( authorized, issued, subscribed, paid up, uncalled, reserved &amp; watered/ Distinguishing features between (i) Private &amp; public limited company, (ii) share &amp; debenture.<br /><br /><strong>MODULE 2: Accounting</strong><br /><br /><strong>Preliminary Concepts of Accounting</strong><br />GAAP (Generally Accepted Accounting Principles) / The account/Double entry recording process/Basic Accounting equation/Golden rules of Accounting/ Identification and analysis of transaction and other events.<br /><strong>Accounting Cycle</strong><br />Recording: Journal/Classifying: Ledger/Summarizing: Trail Balance/ Preparation of final account/Analysis.<br /><strong>Financial statement</strong><br />Components, format &amp; need analysis of the statements (Balance sheet/Income statement/Cash flow statement/ Statement in the change of equity)<br /><strong>Ratio analysis</strong><br />Components, formulas &amp; interpretation of the ratios ( Liquidity ratios/Activity ratios/Leverage ratios/ Profitability ratios)<br /><strong>Cash flow statement</strong><br />Cash flow versus fund flow/Cash flow from operating activities/Cash flow from investing activities/Cash flow from financing activities/ Direct method for cash flow/ Indirect method for cash flow<br /><strong>Tax, VAT &amp; Banking Products</strong><br />Conceptual framework of tax &amp; VAT/ rate and applicability of tax &amp; VAT on banking products/ a short focus on corporate tax.<br /><br /><strong>MODULE 3 : General Banking</strong><br /><br /><strong>Different Types of Customer and Bank Customer Relationship</strong><br />Who is a banker? /Who is a customer? /General relationship between banker &amp; customer /Special relationship between banker &amp; customer/ Rights of a customer/Duties and obligations of a banker/Disclosure &amp; secrecy of customer&rsquo;s account/Termination of Banker-customer relationship.<br /><strong>Deposit Products</strong><br />The liability product lines/ Benefit schedules of the products/ Procedures should be followed/ Major terms &amp; conditions / Study of comparative advantages of products.<br /><strong>Opening of different Types of accounts</strong><br />Different types of accounts/Indicative list of documents required for opening the accounts/Analysis of sources of fund/Analysis of types of documents/Component analysis of required documents/Opening of deposit accounts (application on the prescribed form, introduction of the account, specimen signature, and necessary documentations).<br /><strong>Operation and Closing of Different Types of Accounts</strong><br />Relevant analysis (TP, KYC, SBS etc)/ Operations of the account/Transfer of the account/Monitoring the accounts/Closing the accounts/ handling of deceased, inoperative, dormant &amp; unclaimed deposit accounts.<br /><strong>The Negotiable Instruments Act, 1881&nbsp;</strong><br />Types, essentials &amp; distinguishing features of Negotiable Instruments/Application of different articles of NI Act in the banking industry/Special focus on crossing &amp; endorsement/Special focus on important terms : Holder, holder in due course, payment in due course, apparent tenor, material alteration/ Responsibilities &amp; obligations of a paying banker/ Responsibilities and obligations of a collecting banker/ Notice of dishonour for cheque and subsequent roadmap for legal action.<br /><strong>Contract Act, 1872 and Partnership Act, 1932</strong><br /><strong>For Contract Act-1872:</strong>Title, commencement, enactment/Essentials of a contract/ Offer, counteroffer, proposal, agreement/Interpretation of terms: consent, free consent, consideration, coercion, undue influence, misrepresentation, fraud etc/ Obligation of parties to a contract.&nbsp;<strong>For Partnership Act-1872 :</strong>Definition of partnership, partners, partnership letter, partnership deed, implied authority of a partner/The object of a partnership firm. Number of partners/ Bank account operation by partnership firm/Restrictions on implied power/ Liability of a partner /Situation analysis (Death of a partner, Retirement of a partner, Insolvency of a partner).<br /><strong>Cheques, Crossing and Endorsement</strong><br />Definition, types &amp; objects of crossing/Essentials, forms &amp; significance of general crossing/Essentials, forms &amp;significance of special crossing/Who can cross a cheque ? /Cancellation of crossing/ Definition, types &amp; effects of endorsement/Legal provisions regarding endorsement/ General rules regarding the form of endorsement.<br /><strong>Collecting and Paying Banker</strong><br />The definition of paying banker/ Relevant sections of NI Act for having protections for making payment/ Relevant sections of NI Act for avoidance of risk &amp; liabilities ( Paying banker)/The definition of colleting banker/The conditions required for obtaining protections ( collecting bankers)<br /><strong>Case study</strong><br />Case study on NI Act-1881 &amp; subsequent solution.<br /><strong>Inland Bills &amp; Remittance</strong><br />Definitions &amp; features of DD, PO,TT &amp; MT/ Issuance of DD, PO,TT &amp; MT / Payment of DD, PO,TT &amp; MT/ Issuance of Duplicate DD &amp; PO/ Difference between Cheque &amp; Demand Draft/ Difference between PO &amp; DD/ Common irregularities in local remittance/ General remedies in local remittance/ Precautions to be taken in local remittance.<br /><strong>BACH, BEFTN &amp; RTGS</strong><br />Operational procedures &amp; rules of BACH/ 4 projects of BACH implementation (BACPS, BEFTN, NPS &amp; RTGS)/ MICH cheque details / Collection of cheque- inward &amp; outward clearing/ BACH agenda &amp; returns/ The responsibility of presenting &amp; payee bank in BACH/ Presentment, settlement &amp; time limitations/ Return &amp; return reasons/ Precautionary measures against fraud/ forgery cheque.<br /><strong>Vault &amp; Cash Management</strong><br />Definition &amp;features of cash/function of cash department /-accounting procedure of cash remittance vault maintenance/ shortage &amp; surplus cash management/ Security features of a bank note/ Insurance limits/Checking points for cheque payment/ Disposal of soiled &amp; mutilated notes/ lodgement of keys &amp; duplicate keys.<br /><strong>Money Laundering Prevention Act, 2012 ( with amendments in 2015)</strong><br />Title &amp; commencement/Definitions/Offences &amp; penalty/ Powers of Bangladesh Bank/ Responsibilities of reporting organizations/Mutual legal co-operation/ General provisions.<br /><strong>Prevention of Money Laundering and Terrorist Financing &amp; ML Reporting</strong><br />A short focus on three stages of development of money laundering (Layering, structuring &amp; integration)/General focus on all the circulars/circular letters/Ordinance/acts/ List of predicate offence/ terrorist activities &amp; reporting authorities/ CTR &amp; STR reporting/A special focus on the issues ( PEPs,Power of Bangladesh Bank &amp; Responsibility of Bank officials &amp; Board of Directors)/ Independent Testing Procedures/ CTR analysis &amp; monitoring of structuring/STR indicators/ STR reporting process.<br /><br /><strong>MODULE 4 : Loans &amp; advances</strong><br /><br /><strong>Credit Policy</strong><br />General policy guidelines/Business Focus guidelines. Sectoral lending cap/Credit portfolio mix /General facility parameters/ Loan product &amp; service range. Credit risk assessment &amp; grading/Organizational structure: segregation of duties/ Credit Approval process &amp; authority/Loan pricing.<br /><strong>Credit Products</strong><br />Loan categorization on the basis of purpose/ Loan categorization on the basis of time involved/ Loan categorization on the basis of fund involved/ Loan categorization of the basis of work force &amp; capital invested/ Loan categorization on the basis of CL practice/ Loan categorization on the basis of sector &amp; borrower segment.<br /><strong>Micro &amp; Macro Aspects of Credit: Principles of Sound Lending</strong><br />Safety, security, liquidity, purpose, profitability. (5Cs): Character, capacity, Capital, Collateral &amp; conditions.<br /><strong>Credit Risk Grading : Computation and Analysis</strong><br />Eight credit grading, respective score range &amp; their implications/Five risk categories and their respective score./Analysis of all the judging criteria under the main five risks ( Financial/Industry&amp; Business, management, security &amp; relationship)/ CRG &amp; credit decision.<br /><strong>Case study on CRG</strong><br />Practical demonstration of score through finding out the five risks judged by different parameters<br /><strong>Working Capital Assessment</strong><br />Concept, purpose &amp; variations/Importance of working capital/ Dangers of excessive working capital and inadequate working capital/ Terms analysis: Tied up period, gross vs net working capital, Cash Conversion Cycle (CCC) /Meaning, phases &amp; influencing factors of operating cycle/Working capital assessment for a trading concern/Working Capital assessment for a manufacturing concern/Fixing up TOR (Terms of Reference) for working capital financing.<br /><strong>Project Financing</strong><br />Concept of project/ Financial viability ( cost of project, means of financing, cost of production and profitability, cash generation and debt service coverage ratio, break &ndash;even analysis)/Fixing up TOR (Terms of Reference) for project financing/Term loan eligibility based on security, regulatory &amp; legal aspects.<br /><strong>Lease financing &amp; factoring</strong><br />Concept of leasing &amp; factoring/Fixing up TOR (Terms of Reference) for leasing financing &amp; factoring/ Eligibility based on security, regulatory &amp; legal aspects.<br /><strong>Work order financing</strong><br />Conceptual framework /Modus of operandi/Financing Parameters/ Fixing up TOR (Terms of Reference) for work order financing/ Eligibility study based on security, regulatory &amp; legal aspects.<br /><strong>Bank Guarantee</strong><br />Definition/ Parties to a bank guarantee/Types of bank guarantee (Bid, PG, APG etc)/ Format/ structure study ( Preamble, guarantee clause , duration of a guarantee etc)/ Issuance procedure of guarantee/ - Issuance of guarantee against counter guarantee of International Banks/ Lodgment of claim/Termination of guarantee.<br /><strong>Loan Classification &amp; provisioning</strong><br />Classification of loans /Objective criteria and qualitative judgements / Accounting of the interest of classified loans/Basis for provision/Eligible securities and the determination of their market value/ Rules governing maintenance of provision.<br /><strong>Rescheduling &amp; write off</strong><br />Definition of debt rescheduling/ Purposes of rescheduling/ Cases of rescheduling/Modes of rescheduling/Post rescheduling requirements/Impact of rescheduling in loan portfolio/Write-off in banking. Accounting of write-off/ Impact of write-off in loan portfolio.<br /><strong>Credit securitization</strong><br />Need of security/Types of security/Valuation of security/ Features of a good security/Variation of security on the basis of mode of advance/Control over security/Perfection of security.<br /><strong>Mode of charging of securities</strong><br />What is a charge?/Classification of charge/ The variables for charging over securities/ The common methods of charging securities ( Pledge, hypothecation, mortgage, lien, assignment, set-off)/ Legal aspects of charging over securities.<br /><strong>Documentation</strong><br />What is documentation? Steps of documentation/ General guideline for documentation/Constituents of defective title/Legal opinion from the lawyer/ Stamping of documents/Registration of the documents/ Safekeeping of documents.<br /><strong>Security Documents</strong><br />Identification of Security documents: Title Deed, Bia Deeds, CS, RS, SA, BS Parcha &amp; Khotians, Seperation, Mutation, Order Sheet &amp; DCR, Non-Encumbrance Certificate, Special certificate / NOC etc.<br /><strong>Management of Non-performing loans</strong><br />Factors that cause non-performing loans/Impact of risk management on non-performing loans/Non-performing loans recovery strategies/Impact of recovery on loan portfolio/Capital flight, loan concentration and non performing loans<br /><strong>Legal Aspects</strong><br />The Transfer of Properties Act, 1882 with reference to Mortgage / Stamp Act, 1899 (with amendments).<br /><strong>Legal Aspects</strong><br />&bull; Limitation Act, 1908 &bull; Aurtho Rin Adalot Ain -2003 &ndash; An overview.<br /><strong>SME Banking</strong><br />Objectives of SME loan/Area /cluster approach/ Indifferent definition of small &amp; medium enterprise sector/Industry overview/Product profiles/Features of different SME loans/Different statements/Common irregularities<br /><strong>Different credit products of consumer finance department</strong><br />Objectives of Consumer financing &amp; target group/ Product profiles/Features of the products/Prudential guidelines/Problems, prospects &amp; competitive edge/ Common irregularities<br /><strong>Credit Card</strong><br />Concept of Plastic money/Type of plastic money (ATM, Credit, debit, prepaid, smart cards).Brand (VISA/ Master) features of credit cards. Fixation of credit card limit/Eligibility criteria. Application procedure/ Bangladesh Bank&rsquo;s rule for international card<br /><strong>CIB Process and Reporting</strong><br />Inquiry forms &amp; undertaking/Preparation of CIB statement/ Error in preparation &amp; remedies of errors for CIB statements/Database amendment &amp; drop-out list/ Reporting: Online reporting &amp; software/Wrong reporting &amp; its consequences<br /><strong>Insurance</strong><br />Preliminary concepts of insurance ( peril, hazards, event, accident &amp; loss)/Needs of insurance in banking industry/ Types of insurance policies/ Different types of risks involved in banking practices /Different types of perils covered in the insurance policies.<br /><strong>I-stellar operations in Loans &amp; Advances</strong><br />Module, sub-module &amp; command study of i-stelar related to Credit operations/Common irregularities in execution of instruction/Trouble shooting/Data backup, recovery of data &amp; MIS<br /><strong>Final evaluation on Loans &amp; Advances</strong><br />Examination on knowledge of loans &amp; Advances from all fronts: BA (Broad question)/ SA (Short question)/ CQ (Creative question)/MCQ (Multiple Choice Question)/TF (True/ False) statement/FB (Fill in the Blanks)/IT (Interpretation of Terms)/SM (Simple Mathematics)<br /><br /><strong>MODULE 5 : The Winner&rsquo;s Manual (Soft Skill Development)</strong><br /><br /><strong>Importance of Customer Service in Bank</strong><br />Concept of customer service/importance of customer service in banking industry/different dimensions of customer service/techniques for development of customer service/how to handle customers efficiently?&nbsp;<br /><strong>Time and Stress Management&nbsp;</strong><br />Definition, types, essentials of time management/Definition, types, essentials of stress management/ Connection between time management &amp; stress management/Ways for better time &amp; less stress.&nbsp;<br /><strong>Leadership</strong><br />What is leadership? Types of leadership/Importance of leadership in the workplace/Characteristics of effective leadership/Teaching from great leaders/Difference between a boss and a leader/Difference between a manager &amp; a leader/Leading &amp; Management.&nbsp;<br /><strong>Emotional intelligence</strong><br />Emotional intelligence in management/Components of emotional intelligence/Analysis of the impact of emotion at the workplace/EQ/Application of EQ at workplace/Improving EQ.&nbsp;<br /><strong>Business Correspondence in English</strong><br />Structural analysis of a good business letter/ rules of good business correspondence/ correspondence in GB/ Correspondence in Credit/ Correspondence in Foreign Exchange.&nbsp;<br /><strong>Improving proficiency in English</strong><br />Techniques for improvement of vocabulary / word choice / sentence structure / rules of rejection/ rules of acceptance/ rules for preference.&nbsp;<br /><br /><strong>MODULE 6 : Foreign Trade &amp; Foreign Exchange</strong><br /><br /><strong>Foreign Exchange Regulation Act -1947&nbsp;</strong><br />Purpose of FER Act,1947/Title &amp; extent/Acts in Foreign Exchange/Restrictions on dealing on foreign exchange, agent, import export, foreign companies/Power to call for information, power of inspection/power to government to give direction, powers to make rules/Blocked accounts/Payment for exported goods/False statement/Grant of immunity in certain cases/Penalty &amp; procedures/Tribunal &amp; its power/Bar of legal proceedings.&nbsp;<br /><strong>Export Policy &amp; Import Policy Order</strong><br />Objectives, strategy, application &amp; scope/ General rules and regulations related to the export of Products/Steps towards export diversification/ General export facilities. Product specific export facilities/ Service export/ Different steps towards export promotion.&nbsp;<br />Objectives of import policy/General conditions of import of goods. Import procedures/Import restricted items. HS code/Import for re-export, Entre-port (Ontrapo)/ Pre-shipment inspection/Source of finance of import/Other important features of import policy.&nbsp;<br /><strong>Basics of Foreign Trade &amp; Exchange -</strong><br />Importance of international trade. - Different types of International Trade methods. - Measures of international trade. - Foreign currency exchange. - Determination of foreign exchange rate - Types of transactions &amp; foreign exchange markets. - The role of central bank &amp; intervention.&nbsp;<br /><strong>UCPDC-600 </strong><br />Applicability/Definitions &amp; interpretations of different terms used in the UCPDC-600/Study of differences ( credits vs contracts; documents vs goods, services &amp; performances; etc)/Responsibility &amp; obligation of different banks involved in documentary credit/ Types of documents (Shipping documents, transport documents, insurance documents)/ Discrepancy of documents, effectiveness of documents and standard for examination of documents/Credit, amendment of credit, credit transfer, advising of credit, tolerance in credit amount<br /><strong>Documentary Letter of credit (a general view)&nbsp;</strong><br />Definition/Types of L/C: Sight, Usance including UPAS, Suppliers credit/Cheek list before opening L/C/ Parties to L/C &amp; their responsibilities/Required documents for opening L/C/L/C Opening procedure/ Operation Mechanism/Amendments to L/C/Other Issues<br /><strong>Import Bills scrutiny, lodgement &amp; retirement</strong><br />Introduction/Scrutiny of bill of exchange/Scrutiny of invoices/Scrutiny of the insurance/Scrutiny of the bill of lading/Scrutiny of certificate of Origin/Consular invoice/Scrutiny of other documents/ Steps for lodgement/Steps for retirement/Maintenance of register<br /><strong>Import Financing</strong><br />Types &amp; importance of import financing/PAD (Payment Against Documents)/LIM (Loan Against Imported Merchandise)/LTR (Loan against Trust Receipt)/Modus of operandi &amp; financing parameters.&nbsp;<br /><strong>Export Procedure</strong><br />Registration procedures/Pre-shipment procedures/ Shipment procedures/Realizing export incentives/Post-shipment procedures<br /><strong>Examination and Negotiation of Export documents.&nbsp;</strong><br />List of export documents/Check list for scrutiny of documents (Export L/C, Bill Of Exchange, Invoice, Insurance, Bill Of Lading Certificate Of Origin ,Other Documents)/Common Discrepancies Check List/ Collection &amp; negotiation : process description/Other issues<br /><strong>Export Financing</strong><br />Conceptual frame work of export financing/Importance of export financing /Modus of operandi/Mode of finance: Pre-shipment &amp; Post-shipment (emphasis on BTB L/C, Packing Credit, FDBP&amp; LDBP)/Financing parameters/Export Development Fund/Export failure &amp; stock lot management/Maintenance of export register<br /><strong>Inward &amp; outward foreign remittance</strong><br />Coverage of inward foreign remittance/Sources of inward remittance/Declaration on form C /Declaration on form FMJ .Modes of foreign inward remittance/Operational procedure/Areas of restriction/ Reporting of remittance/Types of outward remittances / Features of private remittance, /Features of official- business remittance /Features of Commercial remittance/Operational procedure/Areas of restriction/Reporting of remittance<br /><strong>Incoterms- 2010</strong><br />Definition/Back ground/Purpose/Change in incoterms (2010) / Different groups of incoterms/Obligation sets of sellers &amp; buyers/Implication and uses of incoterms.&nbsp;<br /><strong>Transport documents</strong><br />Meaning of transport documents/Features of transport documents/Flow of transport documents/Contents of transport documents/Forms of transport documents/Characteristics of main transport documents/ Mode of transport &amp; contract of carriage/Analysis of terms: shipment, partial shipment, transhipment, Consignor, consignee, notify party/Common discrepancies in respect of transport documents<br /><strong>Exchange Rate</strong><br />What is an exchange rate ? Breaking down &ldquo; Exchange Rate&rdquo;/ Determination of Exchange Rates &ndash; Spot &ndash; Cross &ndash; Forward/Different types of operational Exchange rates with exercise/Exchange rate policy&nbsp;<br /><strong>Agency Arrangements &amp; ACU mechanism</strong><br />Credit lines/Add Confirmations/NOSTRO, VOSTRO &amp; LORO Accounts/Exchange Position/Reconciliation/ACU mechanism<br /><strong>URR-725,URC-522 For URR-725 :&nbsp;</strong><br />General provisions and definitions/Liabilities and responsibilities/Form and notification of authorization, amendments &amp; claims/Miscellaneous provisions. For URC-522 : Application/Definition of collection/ Parties of collection/Collection instruction/Other provisions<br /><strong>URDG-758&amp; ISBP-745</strong><br />For URDG-758 : Demand guarantees and counter guarantees in a nutshell/The road to URDG-758/The URDG in nutshell/ The URDG in operation/URDG in the world/ A commentary on URDG 758. For ISBP-745 : Preliminary considerations/ General principles/Drafts and calculations of maturity date/Invoices/Transport documents/Insurance documents &amp; coverage/Certificates of origin.&nbsp;<br /><strong>Foreign Exchange Operations in RMG</strong><br />Financing, operation, incentives, problems, prospects of RMG industry with reference to documentary credit &amp; export financing.&nbsp;<br /><strong>OBU Business</strong><br />Operations, mode of finance , sets of restrictions, scope of expansion , coverage &amp; focus of OBU business<br /><strong>Foreign Exchange Return to Bangladesh Bank</strong><br />Returns for import, export &amp; remittance/Terms analysis of schedules &amp; statements/Online data management/EXP reporting/IMP reporting<br /><strong>I-stellar operations in Foreign Exchange Operations</strong><br />Module, sub-module &amp; command study of i-stelar related to Forex operations/Common irregularities in execution of instruction/Trouble shooting/Data backup, recovery of data &amp; MIS<br /><strong>Final evaluation on Foreign Trade &amp; Foreign Exchange</strong><br />Examination on knowledge of Foreign Trade &amp; Foreign Exchange from all fronts: BA (Broad question)/ SA (Short question)/ CQ (Creative question)/MCQ (Multiple Choice Question)/TF (True/ False) statement/FB (Fill in the Blanks)/IT (Interpretation of Terms)/SM (Simple Mathematics)&nbsp;<br /><strong>Public speaking/ debate</strong><br />Debate on pre-fixed topic<br /><br /><strong>Module 7 : Islamic Banking&nbsp;</strong><br /><br /><strong>Principles of Islamic Banking </strong><br />Prohibition of interest or usury/Ethical standards. Moral values/Social values/Liability &amp; business risk<br /><strong>Principles and Deposit Products under Islamic Banking</strong><br />Deposit product lines of Islamic banking/ (deposit accounts &amp; deposit schemes /Principles of collecting deposit/Al-wadiah principle/ Mudaraba principle/ Quard principle/Features of deposit products/ Basis of differentiation from conventional banking ( Principle &amp; utilization of fund)&nbsp;<br /><strong>Financing Products under Islamic Banking</strong><br />Financing product lines of Islamic banking ( Fixed return base &amp; variable return base)/ Specialty of investment products/Basis of differentiation from conventional banking ( Principle &amp; utilization of fund)&nbsp;<br /><strong>Import &amp; Export Financing under Islamic Banking</strong><br />Import procedures through L/C/Islamic viewpoint about L/C/Opening procedures of L/C in Islamic banking/ Import financing under Bai-murabaha at post import stage/ Import financing under TR on Bai-Muajjal/ Import investment under musharakha/ Pre-shipment investment under Musharakah/ Pre-shipment investment under Bai-salam/Post shipment investment under Musharakha.&nbsp;<br /><br /><strong>Module 8 : Internal Control &amp; Compliance</strong><br /><br /><strong>Internal Control &amp; Compliance in Bank</strong><br />Definition &amp;objectives of internal control/Policy guidelines for internal control/Risk assessment and management/Audit planning, development, procedure, team formation and reporting/Regulatory compliance &amp; compliance process/Monitoring activities, corrective measures &amp; internal control process/ Shariah audit &amp; IT audit.&nbsp;<br /><strong>Common Irregularities in General Banking</strong><br />Lapses in account opening/Lapses in account opening documentation/Lapses in cheque payment/Lapses in inventory control/Lapses in recording keeping/Lapses in coding &amp; reporting/Lapses in Cash Management<br /><strong>Common Irregularities in Loans &amp; Advances</strong><br />Lapses in risk assessment/Lapse in loan documentation. Lapses in valuation of security/Lapses in fulfillment of covenants/Lapses in requirement.&nbsp;<br /><strong>Common Irregularities in Foreign Exchange Operations</strong><br />Lapses in forex transactions/Lapses in documentation/ Violation of export policy/Violation of import policy order /Deviation from FERA,1947/ -Deviation from instruction specified in GFET : -Volume 1 &amp; volume 2<br /><strong>Prevention of Fraud Forgery in Banks</strong><br />Conceptual framework of fraud &amp; forgery/diagnosis technique of fraud &amp; forgery/ early alert system against fraud and forgery / prevention mechanism against fraud &amp;forgery.&nbsp;<br /><br /><strong>Module 9 : Financial Inclusion</strong><br /><br /><strong>Overview of Agent Banking</strong><br />Financial inclusion and agent banking/Restriction and limit guideline imposed by Bangladesh Bank/Modus of operandi of agent banking/Product and service range of agent banking/ Functional jurisdiction and code of conduct for an agent/Role &amp; responsibilities of an ARO/Payment gateway and agent banking/CBS , role of IT &amp; agent banking/Problems &amp; prospects of agent banking.&nbsp;<br /><strong>Islamic Agent Banking operations</strong><br />Modus of operandi, product &amp; service coverage , features of products under Islamic agent banking.&nbsp;<br /><strong>EBEK Operation and Social Safety Payment</strong><br />Financial inclusion and social safety payment/ Prudential guidelines/Modus of operandi of EBEK operations/Role &amp; responsibilities of an ARO/Payment gateway and Social safety Payment/CBS, role of IT &amp; EBEK operations.&nbsp;<br /><strong>Alternative Delivery Channel</strong><br />The Concept of ADC/The range of products &amp; services of ADC department/The importance &amp; potentiality of ADC in Bangladesh/Debit card operation, captured card management/Internet banking, SMS banking, SMS alert service/ATM &amp; POS information, settlement of transaction disputes/Contact center/Process of E-commerce transaction.&nbsp;<br /><br /><strong>MODULE 10 : Risk Management &amp; Others</strong><br /><br /><strong>Risk Management in Banks</strong><br />Overview of banking risk/Fundamental of risk management &amp; Regulatory environment of risk management (International and local)&nbsp;<br /><strong>Risk Management in Banks</strong><br />Residual risk management under Basel-III<br /><strong>Asset&ndash;liability management &amp; Treasury functions</strong><br />GoalObjectives/Organizational structure/ Implementation of strategies /Liquidity management Interest rate risk/Funding plan/Managing mismatch Other ALM issues.&nbsp;<br /><strong>Green Banking &amp; Corporate Social Responsibility</strong><br />For green banking : Conceptual &amp; regulatory frame work/Initiatives : private/ national &amp; global/Our policy adaptation &amp; course of action/Environmental issues/CSR &amp; green banking/Reporting of green banking<br />For CSR : CSR as value creation/CSR as risk management/CSR as corporate philanthropy/Purpose, impact &amp; benefits of CSR/Ethics, CSR &amp; Corporate behavior/Globalization on CSR.&nbsp;<br /><strong>Ethics in Banking</strong><br />The meaning of ethics/The need of ethics in banking/Profit versus ethics : friend or foe ? Transition of ethics/Profit, time horizon &amp; ethics<br /><strong>CAMELS Rating</strong><br />Concept/Component/Calculation mechanism</p>', ' 28 July - 07 September 2018', 'Evening(6.30 pm-9.30 pm)', '10 sessions', 'Friday and Saturday', '30', '27 July, 2018', 'Bdjobs Training, BDBL Building (Level 19), 12 Kawran Bazar C/A, Dhaka 1215', '30000', '55012120 & 55012122 , 01847213994, 01847 069208, 01926 673098', 'info@foreignjobs24.com', 'This course is designed for the business graduates who are interested to start their career in banks and other financial institutions.', 'Md Saiful Islam', 'PHP Programmer ', '<p>&nbsp;started his career in Sales &amp; marketing at Lakhotia Compter Center (LCC), an Indian organization operated in Bangladesh. Later he joined American Express Company, Travellers Cheques Group, where he had opportunity to get more exposed in the challenging world of sales. He attended numerous training programs, workshops on sales &amp; marketing in-country and abroad. Among them, he participated some internationally recognized sells training programs like IMPACT 1&reg;, SPIN&reg; Selling Skills, Consultative Selling Skills, AECR&reg; Workshop, Situational Leadership&reg; in abroad. His enthusiasm, professionalism, determination and extremely customer focused views &amp; mindset, lead him to achieve awards like &ldquo;Expression of Excellence Award&rdquo; (AmEx), &ldquo;Service Excellence Award&rdquo; (EBL). He had hold positions of Relationship Manager, Sales &amp; Service Manager in leading private banks where he demonstrated his selling skills and expertise and successfully achieved the organizational excellence. He loves to study his favorite topics, e.g. sells, self-development, Banking, finance etc. He also loves to teach and share the knowledge he gains with others; as such he conducted much in-house training within the organizations he worked during his long career span. He was selected as trainer in a project of SEDF-IMF funded by World Bank. Where he traveled to Chittagong &amp; Khulna and trained more than 350 participants in 8 separate sessions. Mr. Zaki Mahmud holds Master&rsquo;s Degree in Accounting and currently holding position as First Asst. Vice President in a leading private Bank. He is an active member of Ex-AMEX Employees Association and Rotary Club of Dhaka One.</p>', '2018-07-25', 1);

